import React from 'react'

class Workout extends React.Component {
    state = {
        workout: []
    }

    componentDidMount = () => {
        fetch(`/api/workout/${this.props.match.params.workoutId}`)
            .then(res => res.json())
            .then(workout => {
                this.setState({workout})
            })
    }

    render() {
        console.log(this.state.workout.exercises)
        const workout = this.state.workout;
        const exercises = this.state.workout.exercises;
        console.log(exercises)

        if(exercises) {
            const exerciseNodes = exercises.map(exercise => {
                return (
                    <li key={exercise._id}>
                        {exercise.name}
                    </li>
                ) 
                })
        }

        return (
            <div>
                <h1>Workout name: {workout.name}</h1>

            </div>
        )
    }
}

export default Workout
